import React, {Component} from 'react';
import Header from './header';
import Call_action from './call_action';
import Footer from './footer';

class Home extends Component{
    render(){
       
        return(
            <div className="market_page">
                <div className="wellcom_banner">
                    <Header />
                </div>
                
                <Call_action />
                <Footer />
            </div>
        )
    }
}

export default Home;
